import React, { useState, useEffect } from 'react';
import axios from 'axios';

const ResourcesPage = () => {
  const [resources, setResources] = useState([]);
  const [message, setMessage] = useState('');
  const [loading, setLoading] = useState(true);
  const [file, setFile] = useState(null);
  const [title, setTitle] = useState('');
  const [description, setDescription] = useState('');

  useEffect(() => {
    const token = localStorage.getItem('token');

    if (token) {
      axios
        .get('http://localhost:8000/resources/all', {
          headers: { Authorization: `Bearer ${token}` },
        })
        .then((response) => {
          setResources(response.data.resources);
          setLoading(false);
        })
        .catch((err) => {
          console.error(err);
          setMessage('Error loading resources.');
          setLoading(false);
        });
    } else {
      setMessage('Access denied. Please log in.');
      setLoading(false);
    }
  }, []);

  const handleUpload = async (e) => {
    e.preventDefault();

    if (!file || !title) {
      alert('Please provide a file and a title.');
      return;
    }

    const token = localStorage.getItem('token');
    const formData = new FormData();
    formData.append('file', file);
    formData.append('title', title);
    formData.append('description', description);

    try {
      const response = await axios.post('http://localhost:8000/resources/upload', formData, {
        headers: {
          'Content-Type': 'multipart/form-data',
          Authorization: `Bearer ${token}`,
        },
      });

      console.log('Upload Response:', response.data);

      if (response.data.success) {
        alert('Resource uploaded successfully!');
        setResources([...resources, response.data.resource]);
      } else {
        alert('Failed to upload resource.');
      }
    } catch (error) {
      console.error(error);
      alert('An error occurred while uploading the resource.');
    }
  };

  const handleShare = (fileUrl) => {
    navigator.clipboard.writeText(fileUrl)
      .then(() => {
        alert('File URL copied to clipboard! Share it with others.');
      })
      .catch(() => {
        alert('Failed to copy file URL. Try again.');
      });
  };

  const handleDownload = (fileUrl) => {
    window.open(fileUrl, '_blank');
  };

  return (
    <div>
      <h1>All Resources</h1>

      <div>
        <h2>Upload New Resource</h2>
        <form onSubmit={handleUpload}>
          <input
            type="text"
            placeholder="Resource Title"
            value={title}
            onChange={(e) => setTitle(e.target.value)}
            required
          />
          <textarea
            placeholder="Description (optional)"
            value={description}
            onChange={(e) => setDescription(e.target.value)}
          />
          <input
            type="file"
            onChange={(e) => setFile(e.target.files[0])}
            required
          />
          <button type="submit">Upload</button>
        </form>
      </div>

      {loading && <p>Loading resources...</p>}
      {message && <p>{message}</p>}
      <ul>
        {resources.length > 0 ? (
          resources.map((resource) => (
            <li key={resource.resource_id}>
              <strong>{resource.title}</strong>
              <p>Type: {resource.type}</p>
              <p>Uploaded on: {new Date(resource.upload_date).toLocaleString()}</p>
              <p>{resource.description}</p>
              {resource.file_url && (
                <div>
                  <button onClick={() => handleDownload(`http://localhost:8000${resource.file_url}`)}>
                    Download File
                  </button>
                  <button onClick={() => handleShare(`http://localhost:8000${resource.file_url}`)}>
                    Share File
                  </button>
                </div>
              )}
            </li>
          ))
        ) : (
          <p>No resources available.</p>
        )}
      </ul>
    </div>
  );
};

export default ResourcesPage;
